import React from "react";

function SignUpDetails() {
  return (
    <div style={{ height: "100%", width: "100%", backgroundColor: "skyblue" }}>
     <div>
      <p>Name</p>
      <p>Email</p>
      <p></p>
     </div>
    </div>
  );
}

export default SignUpDetails;
